import Header from "../components/Header";
import Form from "../components/Form";

function Container( { title, pre, image, formProps, report}) {
    return (
        <div className='container' >
            <Header title={title}/>
            {formProps && <Form formProps ={formProps}/>}
            {/* <h3> {JSON.stringify(report)}</h3> */}
            {report.body && <ShowReport report = {JSON.stringify(report).body}/>}
            {pre && <pre> {pre} </pre> }
            {image && <img src = {image} alt = 'mern' height = '400' style={{padding: 20, margin:10}}/>}
        </div>
    );
}

function ShowReport(report) {

    return (
        <div>
            <h3>
                {report.body}
            </h3>
        </div>
    )

}

export default Container;
